operations.content:
subscription ($limit: Int!) {
  hasura_authors(limit: $limit, order_by: {created_at: asc}) {
    __typename
    id
    name
    updated_at
    books(order_by: {created_at: asc}) {
      __typename
      id
      title
      isbn
      updated_at
    }
  }
}

mutation ($crdt: hasura_crdt_insert_input!) {
  hasura_insert_crdt_one(object: $crdt) {
    id
    client
    state
    vector
  }
}

query ($client: String!) {
  hasura_crdt(where: {client: {_eq: $client}}) {
    id
    __typename
    client
    state
    vector
    created_at
    updated_at
  }
}

query ($limit: Int!) {
  hasura_authors(limit: $limit, order_by: {name: asc}) {
    __typename
    id
    name
    updated_at
    books(order_by: {title: desc}) {
      __typename
      id
      title
      isbn
      updated_at
    }
  }
}

query ($limit: Int!) {
  hasura_books(limit: $limit, order_by: {title: asc}) {
    __typename
    id
    title
    isbn
    updated_at
    author {
      __typename
      id
      name
      updated_at
    }
  }
}

subscription ($limit: Int!) {
  hasura_authors(limit: $limit, order_by: {created_at: asc}) {
    __typename
    id
    name
    updated_at
    books(order_by: {created_at: asc}) {
      __typename
      id
      title
      isbn
      updated_at
    }
  }
}

subscription ($limit: Int!) {
  hasura_books(limit: $limit, order_by: {title: asc}) {
    __typename
    id
    title
    isbn
    updated_at
    author {
      __typename
      id
      name
      updated_at
    }
  }
}

mutation ($client: String!, $state: String!, $vector: String!) {
  hasura_update_crdt(
    where: {client: {_eq: $client}}
    _set: {state: $state, vector: $vector}
  ) {
    returning {
      id
    }
  }
}

mutation ($crdt: hasura_crdt_insert_input!) {
  hasura_insert_crdt_one(
    object: $crdt
    on_conflict: {constraint: crdt_client_unique, update_columns: [state, vector]}
  ) {
    id
  }
}

